import React from 'react';

const NavBar = () => {
  const navBarList = ["Boxing", "CrossFit", "Yoga", "Pilate", "Exercise", "Health", "Exercise", "Health"];
  return (
    <>
      <ul className="list-inline NavBar">
        {navBarList && navBarList((item, index) => (
          <li className="active NavBarItems" key={index}>
          <span className="NavBarItems ColumnNav">
            {item}
          </span>
        </li>
        ))}
      </ul>
    </>
  );
};

export default NavBar;
